import './App.css';
import NavigationBar from './components/Navbar';
import Intro from './components/Intro';
import './style/landingPage.css'
import Trending from './components/Trending';

function App() {
  return (
    <div>
      <div className='bgImg'>
        <NavigationBar />
        <Intro />
      </div>
      {/* movie list */}

    <div className='trendingPage'>
      <Trending />
    </div>
    </div>
  )
}

export default App;
